import React from "react";
import { Link } from "react-router-dom";
const Header = () => {
  return <Header>
      <section>
          <div>
          <Link to="/Booking"><button aria-label="On Click">Reserve Table</button></Link>
          </div>
          <img src="" alt="logo"/>
      </section>
  </Header>;
};
export default Header;
